import React from 'react';
import "./style.css";
import re1 from "./images/re1.png"
import { useState } from 'react';

const Resturant = ({ title, handleDelete}) => {


    const [blogs, setBlogs] = useState([
        { title: <img src={re1} />, body: 'Lorem ipsum', author: 'mario', id: 1 },
        { title: 'Welcome', body: 'Lorem ipsum', author: 'mario', id: 2 },
        { title: 'Welcome', body: 'Lorem ipsum', author: 'mario', id: 3 },
    ]);

    return (

        <div className="home">
            {blogs.map((blog) => (
                <div className="blog-preview" key={blog.id}>
                    <h2>{blog.title}</h2>
                    <p> Written by { blog.author }</p>
                    <button onClick={() => handleDelete(blog.id)}> Delete blog</button>
                </div>

            ))}

        </div>
    );
}

export default Resturant;
